Kite (2014)

Never Underestimate a Girl with Nothing to Lose. Based on the groundbreaking, cult classic anime, KITE tells the story of Sawa (India Eisley,&quot;The Secret Life of the American Teenager,&quot; Underworld: Awakening), a young woman living in a corrupt society where crime and gangs terrorize the streets. When Sawa's mother and policeman father are found victims of a grisly double homicide, she begins a ruthless pursuit for the man who murdered them. With the help of her father's ex-partner, Karl Aker (Samuel L. Jackson, Captain America: The Winter Soldier, The Avengers, Django Unchained), and a mysterious friend from her past (Callan McAuliffe, The Great Gatsby, I Am Number Four), she becomes a merciless teen assassin, blasting her way through the dark world of human trafficking only to uncover a devastating truth.
